import React from 'react';
import "./style/Camera.css";


const Camera = () => {
    var img1 = require("./assets/cam.jpg");
    return(
        <div>
            <section className="one-fourth" id="html">
                    <img src={img1} />
            </section>
        </div>

    );
};

export default Camera;
